npx create-react-app client
```
This will create a new React app in a directory called "client".

2. Set up the server:

Create a new file called "server.js" in the root directory of your project:
```
touch server.js
```
Add the following code to "server.js":
```javascript
const express = require('express');
const cors = require('cors');
const bodyParser = require('body-parser');

const app = express();

app.use(cors());
app.use(bodyParser.json());

// Add your routes here

const PORT = process.env.PORT || 5000;

app.listen(PORT, () => {
  console.log(`Server is running on port ${PORT}`);
});
```
This sets up a basic Express.js server with CORS and body-parser middleware.

3. Set up the client:

Navigate to the "client" directory:
```
cd client
```
Add the following code to "src/App.js":
```javascript
import React from 'react';

function App() {
