Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    import spark.implicits._

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.parallelize(List(
      ("query1", 1614556800),
      ("query2", 1614556860),
      ("query1", 1614556920),
      ("query3", 1614556980),
      ("query1", 1614557040),
      ("query2", 1614557100),
      ("query4", 1614557160),
      ("query1", 1614557220),
      ("query2", 1614557280),
      ("query3", 1614557340)
    )).map(x => (x._1, x._2)).toJavaRDD

    // Load top frequent queries
    val topQueries: List[String] = List("query1", "query2", "query3")

    // Broadcast top frequent queries
    val broadcastTopQueries: Broadcast[List[String]] = spark.sparkContext.broadcast(topQueries)

    // Calculate hit rate
    val hitRate = calculateHitRate(onsiteData, broadcastTopQueries)

    println(s"Hit rate: $hitRate")

    spark.stop()
  }

  def calculateHitRate(onsiteData: JavaRDD[(String, Long)], broadcastTopQueries: Broadcast[List[String]]): Double = {
    val cache = mutable.Map[String, (Long, Int)]()

    val hits = onsiteData.mapPartitions(iter => {
      val topQueries = broadcastTopQueries.value
      val hits = ListBuffer[(String, Long)]()

      iter.foreach { case (query, timestamp) =>
        if (topQueries.contains(query)) {
          val cacheEntry = cache.getOrElseUpdate(query, (timestamp, 0))
          if (timestamp - cacheEntry._1 <= 12 * 60 * 60) {
            hits += ((query, timestamp))
            cache(query) = (timestamp, cacheEntry._2 + 1)
          } else {
            cache(query) = (timestamp, 0)
          }
        }
      }

      hits.iterator
    }).count()

    val totalQueries = onsiteData.filter(x => broadcastTopQueries.value.contains(x._1)).count()

    hits.toDouble / totalQueries
  }
}
```
This job first loads the onsite attributed data and top frequent queries. It then broadcasts the top frequent queries to all nodes in the cluster. The `calculateHitRate` function calculates the hit rate by iterating over the onsite attributed data and checking if the query is in the top frequent queries. If it is, it checks if the query is in the cache and if it is, it increments the hit count. If the query is not in the cache or if it has been more than 12 hours since the query was last accessed, it adds the query to the cache with a hit count of 0. The hit rate is then calculated by dividing the number of hits by the total number of queries in the onsite attributed data that are in the top frequent queries.

